import React from "react";
import Charts from "./Charts";

const dailyUsage = [
  { date: "2025-11-14", kWh: 5 },
  { date: "2025-11-15", kWh: 7 },
  { date: "2025-11-16", kWh: 6 },
  { date: "2025-11-17", kWh: 8 },
  { date: "2025-11-18", kWh: 4 },
  { date: "2025-11-19", kWh: 9 },
  { date: "2025-11-20", kWh: 7 },
];

const deviceUsage = [
  { name: "AC", kWh: 20 },
  { name: "Fridge", kWh: 15 },
  { name: "Light", kWh: 10 },
  { name: "Heater", kWh: 5 },
];

function Dashboard() {
  return (
    <div style={{ padding: 20 }}>
      <h2>Dashboard</h2>
      <Charts dailyUsage={dailyUsage} deviceUsage={deviceUsage} />
    </div>
  );
}

export default Dashboard;
